import React, { useState } from "react";
const SignUp = () => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    return (
        <div className="signup-register">
            <h2>Register</h2>
            <input type="text" value={name} onChange={(e) => setName(e.target.value)} placeholder="Enter Your Name"></input>
            <input type="email" value={email} placeholder="Enter Your Email"></input>
            <input type="password" value={password} placeholder="Enter Your Password"></input>
            <button type="submit">Sign Up</button>
        </div>
    )
}
export default SignUp;
